import ReactDOM from 'react-dom';

import './index.css';
import App from './App';


const Index = () => {
    <BrowserRouter>
        <div>
            <Routes>
              <Route path="/" />
              <Route path="/tasks" element={ <TaskList/> } />
            </Routes>
        </div>
    </BrowserRouter>
}
ReactDOM.render(<App />, document.getElementById('root'));
